@OldBobCyprus Last week to much fanfare (about difference between UK v EU vaccinations) the #UK reached 2/3 of adults fully vaccinated - a great achievement. 

One week later, #Ireland reached the same milestone (using the EU #CovidVaccine procurement programme).

#Gaslighting by #BorisJohnson

